import Juegomesa from '../../components/Juegomesa/Juegomesa';
import Tipografia from '../../components/Tipografia/Tipografia';
export default function Desarrolloweb() {
  return (
    <div className="container my-3">
      <div className="container my-3">
        <div className="row">
          <p className="titulo2">Desarrollo web</p>
          <div className="col-sm">
            <p className="titulo6">Página de e-commerce</p>
            <p className="tituloa">P</p>
            <p className="texto1">
              La fuente tipográfica “Twin Stem”, nace a raíz del propósito de ser compartida y
              difundida en libros de ciencias al estilo clásico y elegante, especialmente aquellos
              que combinan ilustraciones botánicas con gráficos detallados, lo que la diferencia es
              su doble asta y las curvas que le caracterizan.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
}
